    # it will give false positives tho.. we should find a better way to handle this.","                        # if LastDataSent \u003e 10:","                        #     LastDataSent = ''","                    except:","                        pass","","","class RemoteShell(cmd.Cmd):","    def __init__(self, server, port, credentials, tid, fid, share, transport):","        cmd.Cmd.__init__(self, False)","        self.prompt = '\\x08'","        self.server = server","        self.transferClient = None","        self.tid = tid","        self.fid = fid","        self.credentials = credentials","        self.share = share","        self.port = port","        self.transport = transport","        self.intro = '[!] Press help for extra shell commands'","","    def connect_transferClient(self):","        #self.transferClient = SMBConnection('*SMBSERVER', self.server.getRemoteHost(), sess_port = self.port, preferredDialect = SMB_DIALECT)","        self.transferClient = SMBConnection('*SMBSERVER', self.server.getRemoteHost(), sess_port=self.port,","                                            preferredDialect=dialect)","        user, passwd, domain, lm, nt, aesKey, TGT, TGS = self.credentials","        if self.transport.get_kerberos() is True:","            self.transferClient.kerberosLogin(user, passwd, domain, lm, nt, aesKey,","                                              kdcHost=self.transport.get_kdcHost(), TGT=TGT, TGS=TGS)","        else:","            self.transferClient.login(user, passwd, domain, lm, nt)","","    def do_help(self, line):","        print(\"\"\""," lcd {path}                 - changes the current local directory to {path}"," exit                       - terminates the server process (and this session)"," lput {src_file, dst_path}   - uploads a local file to the dst_path RELATIVE to the connected share (%s)"," lget {file}                 - downloads pathname RELATIVE to the connected share (%s) to the current local dir"," ! {cmd}                    - executes a local shell cmd","\"\"\" % (self.share, self.share))","        self.send_data('\\r\\n', False)","","    def do_shell(self, s):","        os.system(s)","        self.send_data('\\r\\n')","","    def do_lget(self, src_path):","        try:","            if self.transferClient is None:","                self.connect_transferClient()","","            import ntpath","            filename = ntpath.basename(src_path)","            fh = open(filename,'wb')","            logging.info(\"Downloading %s\\\\%s\" % (self.share, src_path))","            self.transferClient.getFile(self.share, src_path, fh.write)","            fh.close()","        except Exception as e:","            logging.critical(str(e))","            pass","","        self.send_data('\\r\\n')","","    def do_lput(self, s):","        try:","            if self.transferClient is None:","                self.connect_transferClient()","            params = s.split(' ')","            if len(params) \u003e 1:","                src_path = params[0]","                dst_path = params[1]","            elif len(params) == 1:","                src_path = params[0]","                dst_path = '/'","","            src_file = os.path.basename(src_path)","            fh = open(src_path, 'rb')","            f = dst_path + '/' + src_file","            pathname = f.replace('/','\\\\')","            logging.info(\"Uploading %s to %s\\\\%s\" % (src_file, self.share, dst_path))","            if PY3:","                self.transferClient.putFile(self.share, pathname, fh.read)","            else:","                self.transferClient.putFile(self.share, pathname.decode(sys.stdin.encoding), fh.read)","            fh.close()","        except Exception as e:","            logging.error(str(e))","            pass","","        self.send_data('\\r\\n')","","    def do_lcd(self, s):","        if s == '':","            print(os.getcwd())","        else:","            os.chdir(s)","        self.send_data('\\r\\n')","","    def emptyline(self):","        self.send_data('\\r\\n')","        return","","    def default(self, line):","        if PY3:","            self.send_data(line.encode(CODEC)+b'\\r\\n')","        else:","            self.send_data(line.decode(sys.stdin.encoding).encode(CODEC)+'\\r\\n')","","    def send_data(self, data, hideOutput = True):","        if hideOutput is True:","            global LastDataSent","            LastDataSent = data","        else:","            LastDataSent = ''","        self.server.writeFile(self.tid, self.fid, data)","","class RemoteStdInPipe(Pipes):","    def __init__(self, transport, pipe, permisssions, share=None):","        self.shell = None","        Pipes.__init__(self, transport, pipe, permisssions, share)","","    def run(self):","        self.connectPipe()","        self.shell = RemoteShell(self.server, self.port, self.credentials, self.tid, self.fid, self.share, self.transport)","        self.shell.cmdloop()","","# Process command-line arguments.","if __name__ == '__main__':","    print(version.BANNER)","","    parser = argparse.ArgumentParser(add_help = True, description = \"PSEXEC like functionality example using RemComSvc.\")","","    parser.add_argument('target', action='store', help='[[domain/]username[:password]@]\u003ctargetName or address\u003e')","    parser.add_argument('command', nargs='*', default = ' ', help='command (or arguments if -c is used) to execute at '","                                                                  'the target (w/o path) - (default:cmd.exe)')","    parser.add_argument('-c', action='store',metavar = \"pathname\",  help='copy the filename for later execution, '","                                                                         'arguments are passed in the command option')","    parser.add_argument('-path', action='store', help='path of the command to execute')","    parser.add_argument('-file', action='store', help=\"alternative RemCom binary (be sure it doesn't require CRT)\")","    pars